import React, { useState } from 'react';
import '../styles/Profile.css';

function Profile() {
    const [isEditing, setIsEditing] = useState(false);
    const [userData, setUserData] = useState({
        email: 'b.alramlawi360@gmail.com',
        username: 'ggg',
        userType: 'Regular',
        hourlyRate: '$900',
        isVerified: 'Yes',
    });

    const handleEditClick = () => {
        setIsEditing(true);
    };

    const handleSaveClick = () => {
        setIsEditing(false);
        // Add logic to save updated data here
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setUserData({
            ...userData,
            [name]: value,
        });
    };

    return (
        <div className="profile-container">
            <div className="profile-card">
                <div className="profile-header">
                    <img
                        src={process.env.PUBLIC_URL + '/profile.png'}
                        alt="Profile"
                        className="profile-image"
                    />
                    <h2 className="profile-title">Profile Information</h2>
                </div>
                <div className="profile-info">
                    <div className="profile-item">
                        <label className="profile-label">Email:</label>
                        <div className={`profile-field ${isEditing ? 'edit-mode' : ''}`}>
                            {isEditing ? (
                                <input
                                    type="text"
                                    name="email"
                                    value={userData.email}
                                    onChange={handleInputChange}
                                    className="profile-input"
                                />
                            ) : (
                                <p className="profile-value">{userData.email}</p>
                            )}
                        </div>
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Username:</label>
                        <div className={`profile-field ${isEditing ? 'edit-mode' : ''}`}>
                            {isEditing ? (
                                <input
                                    type="text"
                                    name="username"
                                    value={userData.username}
                                    onChange={handleInputChange}
                                    className="profile-input"
                                />
                            ) : (
                                <p className="profile-value">{userData.username}</p>
                            )}
                        </div>
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">User Type:</label>
                        <div className={`profile-field ${isEditing ? 'edit-mode' : ''}`}>
                            {isEditing ? (
                                <input
                                    type="text"
                                    name="userType"
                                    value={userData.userType}
                                    onChange={handleInputChange}
                                    className="profile-input"
                                />
                            ) : (
                                <p className="profile-value">{userData.userType}</p>
                            )}
                        </div>
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Hourly Rate:</label>
                        <div className={`profile-field ${isEditing ? 'edit-mode' : ''}`}>
                            {isEditing ? (
                                <input
                                    type="text"
                                    name="hourlyRate"
                                    value={userData.hourlyRate}
                                    onChange={handleInputChange}
                                    className="profile-input"
                                />
                            ) : (
                                <p className="profile-value">{userData.hourlyRate}</p>
                            )}
                        </div>
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Verified:</label>
                        <div className={`profile-field ${isEditing ? 'edit-mode' : ''}`}>
                            {isEditing ? (
                                <input
                                    type="text"
                                    name="isVerified"
                                    value={userData.isVerified}
                                    onChange={handleInputChange}
                                    className="profile-input"
                                />
                            ) : (
                                <p className="profile-value">{userData.isVerified}</p>
                            )}
                        </div>
                    </div>
                    {isEditing ? (
                        <button className="profile-save-button" onClick={handleSaveClick}>
                            Save
                        </button>
                    ) : (
                        <button className="profile-edit-button" onClick={handleEditClick}>
                            Edit
                        </button>
                    )}
                </div>
            </div>
        </div>
    );
}

export default Profile;
